import './App.css';
import Footer from './Footer';
import { BrowserRouter as Router , Route, Routes} from 'react-router-dom';
import ScrollingText from './Scrolling';
import Header from './Header';
import LoginForm from './user/Login';
import Register from './user/Register';
import UserPage from './user/Userpage';
function App() {
  return (
    <div className="App">
    <Router>
      <Routes>
        <Route path='/' element={<><ScrollingText></ScrollingText><Header></Header><LoginForm></LoginForm><Footer></Footer></>}></Route>
        <Route path='/register' element={<><ScrollingText></ScrollingText><Header></Header><Register></Register><Footer></Footer></>}></Route>
        <Route path='/home' element={<><ScrollingText></ScrollingText><Header></Header><Footer></Footer></>}></Route>
        <Route path='/userpage' element={<><ScrollingText></ScrollingText><Header></Header><Footer></Footer></>}></Route>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
